import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.div`
display: flex;
height: 50px;
width: 100%;
background-color: ${props => props.theme.colors.primary};

`

export const Navbar = props => {
    return(
        <NavContainer>
            <img src={'/perso'}/>

        </NavContainer>
    )
}
